import React from "react";
import ReactDOM from "react-dom";

import App from "./App";
// import "./index.css";


ReactDOM.render(
    <Router>
    <div>
      <Route exact path="/">
        <Home />
      </Route>
      <Route path="/news">
        <NewsFeed />
      </Route>
    </div>
  </Router>,
    document.getElementById("root")
);
